import { privateKeyToPublicKey } from "@nervosnetwork/ckb-sdk-utils";

const dataOutput = "";
//高度为0的区块交易txHash0x6495cede8d500e4309218ae50bbcadb8f722f24cc7572dd2274f5876cb603e4e
const zeroDeps = [
  {
    "depType": "depGroup",
    "outPoint": {
      "txHash": "0x6495cede8d500e4309218ae50bbcadb8f722f24cc7572dd2274f5876cb603e4e",
      "index": "0x0"
    }
  }
];

describe('SimpleUdt  test', () => {

  const CKB = require('@nervosnetwork/ckb-sdk-core').default
  const nodeUrl = 'http://106.13.40.34:8114/';
  const ckb = new CKB(nodeUrl)

  const gPrivateKey = "0x6e678246998b426db75c83c8be213b4ceeb8ae1ff10fcd2f8169e1dc3ca04df1";
  const address = "ckt1qyqfhpyg02ew59cfnr8lnz2kwhwd98xjd4xsscxlae";

  it('001- SimpleUDT Release ', async () => {

    jest.setTimeout(100000);

    //输入地址1 - 提供交易所需的capacity
    const secp256k1Dep = await ckb.loadSecp256k1Dep();
    const publicKey = privateKeyToPublicKey(gPrivateKey);
    const publicKeyHash = `0x${ckb.utils.blake160(publicKey, 'hex')}`;
    const lockHash = ckb.generateLockHash(publicKeyHash, secp256k1Dep)

    //创建着的lockHash,提供消耗的capacity;Inputs数据涞源
    const unspentCells = await ckb.loadCells({
      lockHash
    })

    //002- 构造Outputs
    // 创建一个cell需要消耗30000个capacity
    const sendCapacity = BigInt(3000000000000);
    const sendFee = BigInt(100000000);
    const rawTransaction = ckb.generateRawTransaction({
      fromAddress: address,
      toAddress: address,
      capacity: sendCapacity,
      fee: sendFee,
      safeMode: true,
      cells: unspentCells,
      deps: ckb.config.secp256k1Dep,
    })
    // 001- deps 替换
    rawTransaction.cellDeps = zeroDeps;
    rawTransaction.outputsData[0] = dataOutput; //1000000

    //003- witnesses
    rawTransaction.witnesses = rawTransaction.inputs.map(() => '0x')
    rawTransaction.witnesses[0] = {
      lock: '',
      inputType: '',
      outputType: ''
    }
    // console.log("rawTransaction =>", JSON.stringify(rawTransaction));

    const signedTx = ckb.signTransaction(gPrivateKey)(rawTransaction)
    /**
     * to see the signed transaction
     */
    console.log("signedTx =>", JSON.stringify(signedTx, null, 2))
    const realTxHash = await ckb.rpc.sendTransaction(signedTx)
    /**
     * to see the real transaction hash
     */
    console.log(`The real transaction hash is: ${realTxHash}`)

  })

})